import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import Account_nevbar from './0_component/Account_nevbar/Account_nevbar.js';
import Main_Logo_SearchBar from './0_component/Main_Logo_&_SearchBar/Main_Logo_&_SearchBar.js';

import Three_instruction_TabNevBar from './0_component/Three_instruction_TabNevbar/Three_instruction_TabNevbar.js';
import Supporter_Contents_Container from './0_component/Three_instruction_Tab_Contents/Supports_Contents/Supporter_Contents_Contianer.js';

import Footer from './0_component/Footer_nevbar/Footer_nevbar.js';

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>

  <React.Fragment>

    <Account_nevbar />
    <Main_Logo_SearchBar/>

    <Three_instruction_TabNevBar/>

    <Router>
      <Routes>
    <Route path="/" element={<Supporter_Contents_Container/>}/>
    </Routes>
    </Router>

    <Footer/>

  </React.Fragment>

  </React.StrictMode>
);
